import dummy from "../Data/Dummy.json"

function MainPage() 
{ 
  console.log(dummy);
  return (
    <div>
      <table>
        <tbody>
          <tr>
            <td>{dummy.TastTable[0].Title}</td>
            <td>{dummy.TastTable[0].Day}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );

}

export default MainPage;
